import React from "react";
import Markdown from "markdown-to-jsx";
import { Box, BoxItem, Button, Card, CardContent, Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';
import { ArrowBack } from '@material-ui/icons';
import profilbild from "./images/profilbild_test_2.png"

const Hem = () => {

    const useStyles = makeStyles({

          mainDiv: {
          },
          imgProfile: {
            maxWidth: "250px",
            maxHeight: "250px",
            ['@media (max-width:700px)']: {
              maxWidth: "200px",
              maxHeight: "200px",
              marginLeft: "auto",
            marginRight: "auto",
            }
          },
          boxThing: {
            height: "500px",
            border: "1px solid black",
            textAlign: "left",
            display: "flex",
            flexDirection: "row",
            justifyContent: 'center',
            ['@media (max-width:700px)']: {
              flexDirection: "column",
            }
          },
          textBox: {
            border: "1px solid black",
            margin: "20px",
          },
      })

      const classes = useStyles();
    return (
    <div className={classes.mainDiv}>
  
                        <Typography variant="h4" className = {classes.textWelcome}>
                          Välkommen!
                        </Typography>
                        <Box className ={classes.boxThing}>
                        <Box className ={classes.imgProfile}
                        component="img"
                        alt="Picture did not load"
                        src={profilbild}
                        />
                        <Box className ={classes.textBox}>
                        <Typography variant="h6">
                          Jag studerar sista året på systemvetenskapsprogrammet på Uppsala universitet. Denna sida är ett projekt för att lära mig mer om programmering och datakommunikation. Så småningom siktar jag på att ladda upp en del musik samt andra inlägg! 
                        </Typography>
                        </Box>
                        </Box>
                        
    </div>
    )
    
}

export {Hem}
